import React, { useCallback } from "react";
import PropTypes from "prop-types";

const PostForm = () => {
  const onSubmit = useCallback(() => {}, []);

  return <Form onFinish={onSubmit}></Form>;
};

PostForm.propTypes = {};

export default PostForm;
